import React from 'react';

const ImgCard = props => (
  <div
      id={props.name}
      onClick={() => props.handleClick(props.name)}
    >
    <div className="img-thumbnail">
      <img alt={props.name} src={props.imgage} />
  </div>
  </div>
);

export default ImgCard;
